 of a website and saves them to a folder on your computer. The extension should have a button that, when clicked, takes a screenshot of the current page and saves it to the folder. The extension should also have a settings page where the user can specify the folder to save the screenshots to.

Here is a sample code for a chrome extension that takes screenshots of a website and saves them to a folder on your computer:
```
// manifest.json
{
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "A chrome extension that takes screenshots of a website and saves them to a folder on your computer.",
  "manifest_version": 2,
  "permissions": [
    "activeTab",
    "storage",
    "tabs"
  ],
  "background": {
    "scripts": ["background.js"]
  },
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  }
}

// background.js
chrome.tabs.onUpdated.addListener(function(tabId, changeInfo, tab) {
  if (changeInfo.status === "complete") {
    chrome.tabs.captureVisibleTab(null, {}, function(dataUrl) {
      var filename = "screenshot-" + Date.now() + ".png";
      chrome.downloads.download({
        url: dataUrl,
        filename: filename,
        saveAs: true
      });
    });
  }
});

// popup.html
<!DOCTYPE html>
<html>
  <head>
    <title>Screenshot Extension</title>
    <link rel="stylesheet" href="popup.css">
  </head>
  <body>
    <button id="take-screenshot">Take Screenshot</button>
    <script src="popup.js"></script>
  </body>
</html>

// popup.js
document.getElementById("take-screenshot").addEventListener("click", function() {
  chrome.tabs.query({active: true, currentWindow: true}, function(tabs) {
    chrome.tabs.captureVisibleTab(null, {}, function(dataUrl) {
      var filename = "screenshot-" + Date.now() + ".png";
      chrome.downloads.download({
        url: dataUrl,
        filename: filename,
        saveAs: true
      });
    });
  });
});
```
In this code, we first define the manifest.json file, which contains the necessary metadata for the extension. We then define the background.js file, which listens for changes to the active tab and takes a screenshot when the tab is loaded. The popup.html file contains the user interface for the extension, including a button that triggers the screenshot taking process. Finally, the popup.js file contains the JavaScript code that handles the button click event and takes the screenshot.

